import React from 'react'

const MoreInfo = ({dataausr}) => {

  return (
    <div className='container_more_info'>MoreInfo

    <p>{dataausr.houses.map((item,index)=>(
      <div key={index}>
        {item.description}
      </div>
    ))}</p>
    </div>
  )
}

export default MoreInfo
